import React from "react";
import user from "../../../img/icon_user.png";
import style from "../Navbar.module.css"
import {NavLink} from "react-router-dom";

const User = () => {
    return (
        <div>
            <NavLink to="/Profile"><img src={user} alt="user"/></NavLink>
        </div>
    );
}

export default User;
